<!-- Begin Component: Manualsubnav -->
<section class="module-manualsubnav component">
    <h3 class="tertiary-head">{{hbs.manualsubnav.title}}</h3>
    <ul class="nav-elements-list">
        {{#each hbs.manualsubnav.links}}
        <li><a href="{{this.url}}" alt="{{this.label}}" title="{{this.label}}">{{this.label}}</a></li>
        <div class="devider"></div>
        {{/each}}
    </ul>
</section>
<!-- End Component: Manualsubnav -->
